    <div class="row">
        <h4>URL</h4>
        <p><b>http://localhost:8000/api/invoice/upload/v3</b></p>
    </div>
    <hr>
    <div class="row">
        <h4>Description</h4>
        <p>This API is for uploading invoice data from tablet to server.</p>
        <ol>
            <li>Tablet uploads tables with data according to invoice API input format.</li>
            <li>In server side, activation keys from input json are checked.</li>
            <li>If valid, proceeds to next step. Else,stops by returning error message.</li>
            <li>In server side, check if keys of table(table names) exist.</li>
            <li>If key exists, gets IDs from value field and clear data with that IDs from database. Then, insert data into database.</li>
            <li>If tables are in header & detail format, check isset() for header data first, clear detail data first, and insert header data first.</li>
            <li>Else, skip that table and continues to next table.</li>
            <li>Repeat this procedure for all tables.</li>
            <li>If there is an error in data insertion, database is rolled back to its original state.</li>
            <li>After all tables are successfully inserted, commit database.</li>
            <li>After commit, for return data, check if schedule exists.</li>
            <li>If schedule exists, 'enquiries,schedules,schedule_treatment_histories,patients,patient_medical_history,patient_family_history,patient_surgery_history,patient_family_member' are retrieved from database according to patient_id in schedules and returned to tablet.</li>
            <li>If schedule does not exist, only enquiries within last three days and status='new' are retrieved and returned to tablet. Other fields are returned with empty array.</li>
            <li>API logs are recorded.</li>
        </ol>
    </div>
